{'pk': 17878345231798907, 'user_id': 3178593942, 'text': '«Ya en su libro anterior, Dos mil doscientos ochenta y uno, Catalano adelantaba su propuesta: un tipo de escritura fragmentaria que exploraba la intimidad de una joven que se muda sola y las percepciones que tiene de su entorno. El año que viene saldrá un libro de relatos en Outsider. “Mi escritura es un poco border”, dice. Agustina es una narradora que ajusta su ojo en cuanto avanza su relato. Por eso, a partir de algunas temáticas o atmósferas que se perciben en sus relatos, le pedimos que nos cuente su recorrido de lecturas.»

Agustina Catalano dialoga con Mariano Vespa para el blog de Eterna Cadencia. Una linda vuelta. 
@agusti_na_
@elgranpezlibros
