{'pk': 17887113625511505, 'user_id': 3178593942, 'text': 'En estas épocas de cuarentena y resguardo toca, entre otras cosas, la lectura. Por eso el domingo compartimos la edición digital y ampliada de "Los pacientes", de @anarociojouli .

Hoy les compartimos el libro "Nadie escuchó el último secreto", del grande y querido @agustin.marangoni .

Dice Camilo Sánchez a propósito de este curioso y hábil libro: «Agustín Marangoni, en este libro de microrrelatos, se ríe de los formatos tradicionales. Lo suyo es un allegro ma non tropo que toma cuerpos diversos, algo así como bromas-haiku o ciertos pensamientos furtivos de los que configuran el mundo. Es decir, arma su propio big bang y se baja, para fumar, justo antes de que el colectivo atraviese, en la próxima avenida, esa barrera baja.» / En la bio encuentran nuestra página. Ahí los espera el link para ver online o descargar de Google DRIVE.', 'type': 1, 'created_at': 1585235924, 'created_at_utc': 1585235924, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 3178593942, 'username': 'labolaeditora', 'full_name': 'la Bola editora', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/34982898_409737822847199_6409279064737054720_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=m71IqdQlhgcAX_nZA_g&_nc_tp=25&oh=aa6d3ae17944d64c31ebec12fbd7602f&oe=5FD667CA', 'profile_pic_id': '1808282679643097776_3178593942', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1605009629, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2273444387088245334, 'has_translation': True, 'private_reply_status': 0}

{'pk': 17882487916511169, 'user_id': 3178593942, 'text': '"Corre el año 1989 y Verónica Wiggenhauser nos lleva a una época en donde uno podía encontrar a su ídolo en un VHS, aquel preciado sistema de video casero que nos permitía verlo cuantas veces quisiera (siempre y cuando no hubiese que rebobinar la cinta y devolverla). A través de una pluma fresca y sencilla, la autora nos cuenta cómo conoció a quien sería su primer amor e inspiración de por vida: David Bowie. Un Bowie mítico y de ensueño, del cual ya no quería (ni podía) desprenderse. 
Un cuento mitad biográfico, mitad ficción,  que nos sorprende fuertemente." @notaftereverything sobre el relato de @misswiggen. Conseguilo en MDP en @elgranpezlibros

