{'pk': 17970327292032985, 'user_id': 3178593942, 'text': 'Ya estamos trabajando en la edición y traducción de “Perfect Discipline and Unbending Loyalty”, de @tommi_pg, nuestra próxima novela gráfica bomba.
.
Aquí les dejamos alguna imágen para que vayan alimentando la ansiedad. Estamos más que felices de poder contar con esta belleza en el catálogo de la editorial. .
