{'pk': 17959817632079235, 'user_id': 3178593942, 'text': 'En la 7° @feriadeeditores estará disponible uno de los libros que más disfrutamos armar, leer, releer y tener en las manos: "Por el camino de tierra", de Eric Schierloh. 
Diice Matías Moscardi:

俳文 «Este ideograma corresponde a la palabra japonesa "haibun", escritura que combina la condensación visual y conceptual del haiku y la recolección heterogénea de experiencias que confluyen en un diario de viaje: fotos de paisajes atomizados en un punto –un poste de luz, una sombra, una piña en la hierba, el cadáver de una liebre, una fila de loros en el camino–, dibujos de escenas, estampas o mapas, retratos de animales –perro, pez, polilla–, recordatorios literarios o archivos bibliográficos, notas mentales, versos como acotaciones reflexivas sobre el viento o la marea, textos que procesan la experiencia del entorno natural y las transiciones entre los distintos estados de la materia poética –una foto puede devenir, indistintamente, dibujo o verso, el fantasma invisible de la brisa puede transformarse en imagen, un pensamiento puede ser un surco calado en la superficie del mar. Por el camino de tierra, de Eric Schierloh, es un libro de supervivencia: hay algo artesanal en su escritura que convoca el uso vital de todos los materiales disponibles. En estos poemas, se cruzan la novela de aventuras, el aura del náufrago, el espíritu del explorador, el retiro nevado del ermitaño, con el estoicismo imperturbable del Samurái: la lectura nos hipnotiza en un trance de isla desierta, nos confina a una lejanía imaginaria que nos hace escuchar, otra vez, los sonidos fundamentales del mundo por sobre el ruido de la civilización. El efecto es, por supuesto, el de la desposesión: no tener otra cosa que un lápiz, una libreta. »', 'type': 1, 'created_at': 1533867532, 'created_at_utc': 1533867532, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 3178593942, 'username': 'labolaeditora', 'full_name': 'la Bola editora', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/34982898_409737822847199_6409279064737054720_n.jpg?_nc_ht=instagram.faep9-2.fna.fbc